TEMPLATES = {
    # Social Media Posts
    "Infographic": [
        # INFOGRAPHIC_TEMPLATE_6,
        INFOGRAPHIC_TEMPLATE_7,
        INFOGRAPHIC_TEMPLATE_8,
        INFOGRAPHIC_TEMPLATE_9,
        INFOGRAPHIC_TEMPLATE_10,
        INFOGRAPHIC_TEMPLATE_11,
    ],
    "Infographic_letter": [
        INFOGRAPHIC_TEMPLATE_5,
    ],
}


def get_template(template_name):
    """Get a template by name"""
    if template_name in TEMPLATES:
        return copy.deepcopy(TEMPLATES[template_name][0])
    return None


def get_templates_by_section(section_name):
    """
    Get all templates for a specific section

    Args:
        section_name (str): The section name (e.g., 'Infographic')

    Returns:
        list: List of templates for the given section, or empty list if section not found
    """
    if section_name in TEMPLATES:
        return copy.deepcopy(TEMPLATES[section_name])
    return []


def get_all_templates():
    """
    Get all template definitions organized by section and template

    Returns:
        dict: Dictionary with structure {section_name: [template1, template2, ...]}
    """
    templates_dict = {}

    for section_name, template_list in TEMPLATES.items():
        templates_dict[section_name] = copy.deepcopy(template_list)

    return templates_dict
